import { FC, useState } from 'react';
import doctorImage from '../assets/doctor.svg';
import MenuIcon from '../assets/menu-mobile.png';

type HeaderProps = {
    showMenu: boolean,
    setShowMenu: () => false,
}

const MenuMobile = (showMenu: any) => (
    <div className={showMenu ? 'menu-mobile-list open-menu' : 'menu-mobile-list'}>
        <ul>
            <li><a href="#">Tratamientos</a></li>
            <li><a href="#">Consulta online</a></li>
            <li><a href="#">Quiénes somos</a></li>
            <li><a href="#">Preguntas frecuentes</a></li>
            <li><a href="#">Contacto</a></li>
            <li><a href="#">¿Tenés dudas?</a></li>
        </ul>
    </div>
);

const Header: FC<HeaderProps> = () => {

const [showMenu, setShowMenu] = useState<HeaderProps | false>(false);

const handleChange = () => {
    setShowMenu(showMenu)
}
    return (
        <header className='header'>
            <div className='container-header'>
                <nav className='navbar'>
                    <h1>Choiz</h1>
                    <div 
                        className='menu-mobile'
                        onClick={handleChange}
                    >
                        <img src={MenuIcon} alt="Cuestionario"/>
                    </div>
                    {showMenu && <MenuMobile showMenu={showMenu} />}
                    <ul className='menu-desktop'>
                        <li><a href="#">Tratamientos</a></li>
                        <li><a href="#">Consulta online</a></li>
                        <li><a href="#">Quiénes somos</a></li>
                        <li><a href="#">Preguntas frecuentes</a></li>
                        <li><a href="#">Contacto</a></li>
                        <li className='menu-item-button'><a href="#">¿Tenés dudas?</a></li>
                    </ul>
                </nav>
                <h2>Cuidarte siempre te cuesta menos con Choiz</h2>
                <div className='wrapper-image'>
                    <img src={doctorImage}  alt="doctor" />
                </div>
            </div>   
        </header>
    );
}


export default Header;
